import React , { useState, setState }from 'react';
import { Feather } from '@expo/vector-icons';
import { View, Image, TouchableOpacity, Text, TextInput } from 'react-native';
import { useNavigation } from '@react-navigation/native';

import { WebView } from 'react-native-webview';

import logoImg from '../../assets/idook.png';
import logoCliente from '../../assets/sindpd.png';
import styles from './styles';

export default function Incidents() {
    const navigation = useNavigation();

    function navigateToRegister() {
        navigation.navigate('Register');
    }

    const [email, password, errorMessage] = useState('');

    console.log(email)



    return (
        <View style={styles.container}>
            <View style={styles.header}>
                <Image style={styles.logo} source={logoCliente} />
            </View>  

            <View style={{alignItems:'flex-start'}}>
            <Text style={styles.title}>Olá,</Text>
            <Text style={styles.description}>Bem vindo de volta o seu IDook</Text>

            </View>

            <View style={styles.errorMessage}>
                {errorMessage && <Text style={styles.error}>{errorMessage}</Text>}   
            </View>   

            <View style={styles.form}>
                <View>
                    <Text style={styles.inputTitle}>Email</Text>
                    <TextInput 
                    style={styles.input} 
                    autoCapitalize='none'
                    onChangeText={email => setState(email)}
                    value={email}
                    ></TextInput>
                </View>
            </View>

            <View style={styles.form}>
                <View style={{marginTop: 5}}>
                    <Text style={styles.inputTitle}>Senha</Text>
                    <TextInput 
                    style={styles.input} 
                    secureTextEntry 
                    onChangeText={password => setState(password)}
                    value={password}
                    autoCapitalize='none'
                    ></TextInput>
                </View>
            </View>

            <TouchableOpacity style={styles.button}>
                <Text>Login</Text>
            </TouchableOpacity>

            <TouchableOpacity
                    style={{ alignSelf: "center", marginTop: 32 }}
                    onPress={navigateToRegister}
                >
                    <Text style={{ color: "#414959", fontSize: 13 }}>
                        Ainda não tem um IDook? <Text style={{ fontWeight: "700", color: "#000000" }}>Registrar</Text>
                    </Text>
                </TouchableOpacity>

            <View style={{alignItems:'flex-end'}}>
                <Image style={styles.logo2} source={logoImg} />
            </View>

        </View>
    );
}
